import React from "react";
import styles from "./Header.module.css";

const Header = () => {
  return (
    <header className={styles.header}>
      <div style={{
      fontFamily: 'inherit',
      fontSize: '50px'  
      }}
      className={styles.logo}>TrueLive.AI</div>
      <nav>
        <ul className={styles.navList}>
          <li>Home</li>
          <li>Pages</li>
          <li>Blog</li>
          <li>Contact</li>
        </ul>
      </nav>
      <button className={styles.loginBtn}>Register / Login</button>
    </header>
  );
};

export default Header;
